import React from 'react'
import './Avtar';

const Profile = () => {
    const EmpDetails = {
        img_Url: "Avtar.webp",
        name: "Alok Prajapati",
        email: "alok.p90@gmail.com",
        city: "Banglore",
        phone: 9864344798
    }
  return (
    <div>
      <div className="image">
        {EmpDetails.img_Url}
      </div>
    </div>
  )
}

export default Profile
